import React from 'react'
import AppList from './list/AppList'
import AppDetails from './details/AppDetails'


class App extends React.Component {
	constructor (props){
		super(props)
	}

	hendleDataCallback = (Msg) => {
		var data = Msg.list
		this.props.dataCallBackDetais(data)
	}
	callBackDetais = (CallBack) => {
		var data = CallBack
		this.props.dataBack(data)
	}
	render() {
		console.log(this.data)
		return(
			<div> 
				<div className="left">
		         	<div className="coll">
		              <label className="txt-input">
		                <input type="text" id="sum_human" name="sum_human" className="valid" aria-invalid="false" />
		              </label>
		         	</div>
		         	<AppList dataCallBackDetais={this.callBackDetais}  />
			    </div>
		      	<div id="details" className="right">
		      		<AppDetails infoDetails={this.dataBack} />
		      	</div>
		    </div>
		)
	}
}

export default App
